import "./App.css";
import ReactPlayer from "react-player";

function App() {



  return (
    <div id="App">
      <div id="TopSection">
        <h1 id="CompanyName">EnergyTime</h1>
        <h2 id="CompanyMatra">E x T = Money</h2>
     </div>
     <div id="MiddleSection">
       <div id="VideoContainer">
        <ReactPlayer 
          url="https://vimeo.com/514419233"
          controls="true"
          playsinline="true"
        />
      </div>
     </div>
     <div id="BottomSection">
        <h3 id="CompanyType">EnergyTime LLC</h3>
        <h3 id="CompanyEmail">hi@energyti.me</h3>
     </div>
    </div>
  );
}

export default App;
